INSERT INTO `noticias_pachamas` VALUES (4,'¡Pachamá Regresa esté 2023!','Estamos feliz de anunciar que Pachamá, regresa para traer nuevas actividades de concientización y educación del medio ambiente. Espéranos pronto','https://api.tarjetajovendiamante.com/storage/images/noticiasinformativas/2023_05_17//4QCnuvtyKJ72j3NA2OBF0wO1jjFbw2QvkMNPwB1z.jpg','2023-05-17 19:52:46','2023-05-18 20:25:46',1,NULL,NULL,NULL,NULL,NULL),(7,'FIRMA DE ALIANZA ESTRATÉGICA ENTRE GRUPO PACHAMÁ E ISAE UNIVERSIDAD','Realizaron la firma de un convenio de colaboración, con el fin de establecer las bases para la realización de actividades de cooperación, de intercambio académico y de concienciación ambiental, entre ambas instituciones.','https://api.tarjetajovendiamante.com/storage/images/noticiasinformativas/2023_06_09//lVJf0MzaniKn1GTe3Xhdetu79dw2dz4NofJDSjD2.jpg','2023-06-09 15:23:35','2023-06-09 15:23:35',1,NULL,NULL,NULL,NULL,NULL),(8,'FIRMA DE CONVENIO ENTRE PACHAMÁ Y UNIVERSIDAD DEL ARTE GANEXA','Firma de convenio de colaboración para el desarrollo de proyectos de extensión, investigación y prácticas profesionales entre Pachamá Ecológico y Universidad del Arte GANEXA.','https://api.tarjetajovendiamante.com/storage/images/noticiasinformativas/2023_06_09//hwzJ8NaBSYtiSFSs5tg8XTNvCvz6118La75TFdEJ.jpg','2023-06-09 16:55:49','2023-06-09 16:55:49',1,NULL,NULL,NULL,NULL,NULL),(9,'Cerramos un convenio en el marco de cooperación con PROM COUNSELORS, S.A.','Prom Counselors es una empresa dedicada al desarrollo académico y profesional, basándose en las habilidades inherentes de nuestros jóvenes.\r\n\r\nEste año, nuestra primera fase es afiliar comercios con beneficios en salud y en una segunda fase, turismo y gastronomía.\r\n\r\nSigue nuestras últimas afiliaciones que todos los días crecen podrás tener acceso por medio de nuestra membresia Tarjeta Joven Diamante. \r\nPuedes sugerir que comercios quieres que sean parte de nuestras afiliaciones, escríbenos a través de nuestras redes: \r\n@tarjetajovendiamante\r\n@grupopachama.','https://api.tarjetajovendiamante.com/storage/images/noticiasinformativas/2023_06_09//o7lA54g9bFZxc05KaktBqhpHY9OqBlyYZr60nOMp.jpg','2023-06-09 17:00:43','2023-06-09 17:03:01',1,NULL,NULL,NULL,NULL,NULL);
